<script>
var VSMap = {
    colors: [
       [ "#008000", "#FFFF00", "#008000", "#FFFF00", "#008000" , "#FFFF00"],
        [ "#008000", "#FFFF00", "#008000", "#FFFF00", "#008000" , "#FFFF00"],
        [ "#008000", "#FFFF00", "#008000", "#FFFF00", "#008000", "#FFFF00" ],
        [ "#008000", "#FFFF00", "#008000", "#FFFF00", "#008000" , "#FFFF00"],
    ],
    alt_radio_colors: [ "#008000", "rgb(255,255,0)", "rgb(255,255,0)", "rgb(127,127,205)", "rgb(127,205,127)" ],
    palette: 0,
    states: {},

    stateclick: function() {
        VSMap.states[this.id] = (VSMap.states[this.id] + 1) % 5;
        this.setAttribute("fill",VSMap.colors[VSMap.palette][VSMap.states[this.id]]);

        var formid = this.id + "_" + VSMap.states[this.id];
        var button = document.getElementById(formid);
        button.checked = true;

        if (document.selection && document.selection.empty) {
            document.selection.empty();
        } else if (window.getSelection) {
            var sel = window.getSelection();
            sel.removeAllRanges();
        }
    },
    

    radioclick: function() {
        var svgstate = document.getElementById(this.name);
        VSMap.states[this.name] = Number(this.value);
        svgstate.setAttribute("fill", VSMap.colors[VSMap.palette][this.value]);
    },

    paletteclick: function() {
        var letters = { M:0, B:1, G:2, E:3 };
        if (VSMap.palette == letters[this.value]) { return }
        VSMap.palette = letters[this.value];

        for (var key in VSMap.states) {
            if (VSMap.states.hasOwnProperty(key)) {
                var s = document.getElementById(key)
                s.setAttribute("fill",VSMap.colors[VSMap.palette][VSMap.states[key]])
            }
        }

        var p = VSMap.colors[VSMap.palette]
        if (VSMap.palette == 0) { p = VSMap.alt_radio_colors; }
        var r1 = document.getElementsByClassName("radio1");
        for (var i = 0, len = r1.length; i < len; i++) {
            r1[i].style.backgroundColor = p[1];
        }
        var r2 = document.getElementsByClassName("radio2");
        for (var i = 0, len = r2.length; i < len; i++) {
            r2[i].style.backgroundColor = p[2];
        }
        var r3 = document.getElementsByClassName("radio3");
        for (var i = 0, len = r3.length; i < len; i++) {
            r3[i].style.backgroundColor = p[3];
        }
        var r4 = document.getElementsByClassName("radio4");
        for (var i = 0, len = r4.length; i < len; i++) {
            r4[i].style.backgroundColor = p[4];

        }
		  var r5 = document.getElementsByClassName("radio5");
        for (var i = 0, len = r5.length; i < len; i++) {
            r5[i].style.backgroundColor = p[5];
        }
    },
};
window.onload = function() {
    if (! Modernizr.inlinesvg) { return; }
    var paths = document.getElementsByTagName("path");
    var polys = document.getElementsByTagName("polygon");
    for (var i = 0, len = paths.length; i < len; i++) {
        paths[i].onclick = VSMap.stateclick;
        VSMap.states[paths[i].id] = 0;
    }
    for (var i = 0, len = polys.length; i < len; i++) {
        polys[i].onclick = VSMap.stateclick;
        VSMap.states[polys[i].id] = 0;
    }

    var inputs = document.getElementsByTagName("input");
    for (var i = 0, len = inputs.length; i < len; i++) {
        if (inputs[i].name == "palette") {
            inputs[i].onclick = VSMap.paletteclick;
        } else {
            inputs[i].onclick = VSMap.radioclick;
        }
    }

}

</script>

